sys_variable_value.value:
(function execute(inputs, outputs) {

  var payload = {
   "solicitations_publication": {
        "created_by_id": inputs.requestor_id,
        "selected_document_ids": []
    }
  }

  var arr = inputs.doc_ids.split(",");
  for (var i = 0; i < arr.length; i++) {  
  	payload.solicitations_publication.selected_document_ids.push(parseInt(arr[i]));
  }
  outputs.payload = JSON.stringify(payload); 
})(inputs, outputs);

